import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  CircularProgress,
  Alert,
} from '@mui/material';

const PortfolioScreen = () => {
  const [portfolio, setPortfolio] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [totalPL, setTotalPL] = useState(0);

  useEffect(() => {
    const fetchPortfolio = async () => {
      try {
        const token = localStorage.getItem('token'); // replace with your auth logic
        const res = await axios.get('http://localhost:5000/api/portfolio', {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log("Portfolio Response:", res.data);
        const formattedData = res.data.map((item) => {
          const avgBuyPrice = parseFloat(item.avgBuyPrice) || 0;
          const marketValue = parseFloat(item.marketValue) || 0;
          const quantity = parseFloat(item.qty) || 0;
          const buyValue = avgBuyPrice * quantity;
          const profitLoss = marketValue - buyValue;

          return {
            ...item,
            avgBuyPrice,
            marketValue,
            quantity,
            profitLoss,
          };
        });

        const total = formattedData.reduce((acc, row) => acc + row.profitLoss, 0);

        setPortfolio(formattedData);
        setTotalPL(total);
        setLoading(false);
      } catch (err) {
        setError('Failed to load portfolio'+err);
        setLoading(false);
      }
    };

    fetchPortfolio();
  }, []);

  if (loading) return <CircularProgress />;
  if (error) return <Alert severity="error">{error}</Alert>;

  return (
    <Paper sx={{ padding: 3 }}>
      <Typography variant="h4" gutterBottom>
        Your Portfolio
      </Typography>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Symbol</strong></TableCell>
              <TableCell><strong>Quantity</strong></TableCell>
              <TableCell><strong>Avg Buy Price</strong></TableCell>
              <TableCell><strong>Market Value</strong></TableCell>
              <TableCell><strong>P/L</strong></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {portfolio.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{row.symbol}</TableCell>
                <TableCell>{row.quantity}</TableCell>
                <TableCell>${row.avgBuyPrice.toFixed(2)}</TableCell>
                <TableCell>${row.marketValue.toFixed(2)}</TableCell>
                <TableCell
                  style={{ color: row.profitLoss >= 0 ? 'green' : 'red' }}
                >
                  ${row.profitLoss.toFixed(2)}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Typography variant="h6" sx={{ marginTop: 2 }}>
        Total P/L:{' '}
        <span style={{ color: totalPL >= 0 ? 'green' : 'red' }}>
          ${totalPL.toFixed(2)}
        </span>
      </Typography>
    </Paper>
  );
};

export default PortfolioScreen;
